import React, {useContext} from "react";
import 'bootstrap/dist/css/bootstrap.css';
import { NavLink } from "react-router-dom";
import {NavDropdown, NavDropdownItem, NavDropdownDivider, NavDropdownHeader} from 'react-bootstrap';
import {UserContext} from "../App";

const Navbar = () => {
    const {state, dispatch} = useContext(UserContext);

    return (
        <div>
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <div className="container-fluid">
                    <a className="navbar-brand ms-4" href="/">
                        <img src="https://static.wixstatic.com/media/5602be_11b8ffca7ff94b28872e166194045e3e~mv2.png/v1/fill/w_332,h_100,al_c,q_85,usm_0.66_1.00_0.01/ecovia%20logo%20copy.webp" alt="ecovia-logo" width="145" height="45" />
                    </a>
                    <button type="button" className="navbar-toggler" data-bs-toggle="collapse" data-bs-target="#navbarCollapse">
                        <span className="navbar-toggler-icon"></span>
                    </button>   
                    <div className="collapse navbar-collapse" id="navbarCollapse">
                        <div className="navbar-nav ms-auto me-auto">
                            if(state){
                                <>
                                <NavLink to="/inventory-list" className="nav-item nav-link">Inventory</NavLink>
                                <NavLink to="/profile" className="nav-item nav-link">Profile</NavLink>
                                <NavDropdown title="Add" id="collasible-nav-dropdown">
                                <NavDropdown.Item href="/profile">New Bag</NavDropdown.Item>
                                    <NavDropdown.Divider />
                                <NavDropdown.Item href="/add-inventory">New Inventory Store</NavDropdown.Item>
                                </NavDropdown>
                                <NavDropdown title="Delete" id="collasible-nav-dropdown">
                                <NavDropdown.Item href="/profile">Delete Bag</NavDropdown.Item>
                                </NavDropdown>
                                <NavDropdown title="Transfer" id="collasible-nav-dropdown">
                                    <NavDropdown.Item href="/transfer-inventory">Transfer Inventory</NavDropdown.Item>
                                    
                                </NavDropdown>
                                <NavLink to="/logout" className="btn btn-sm btn-outline-danger me-4">
                                    Log out
                                </NavLink>
                                </>
                            } else{
                                <>
                                    <NavLink to="/" className="nav-item nav-link active">Home</NavLink>
                                    <NavLink to="/login" className="nav-item nav-link active">Login</NavLink>
                                    <NavLink to="/register" className="nav-item nav-link active">Register</NavLink>
                                </>
                            }
                        </div>
                    </div>
                </div>
            </nav>
        </div>
    );
}

export default Navbar;
